import React, { Component } from "react";
import { Link } from "react-router-dom";

export default class Navbar extends Component {
  constructor(props) {
    super(props);

    console.log(localStorage.getItem("loggedInStatus"));

    //const loggedInStatus = localStorage.getItem("loggedInStatus");
    //this.state.loggedInStatus = localStorage.getItem("loggedInStatus");
    this.state = {
      loggedInStatus : localStorage.getItem("loggedInStatus")
    }
    
  }

  onForceHandler(){
    this.forceUpdate();
  }

  render() {
    if (this.state.loggedInStatus) {
      return (
        <nav className="navbar navbar-dark bg-dark navbar-expand-lg">
          <Link to="/" className="navbar-brand">
            Terminarz
          </Link>
          <div className="collpase navbar-collapse">
            <ul className="navbar-nav mr-auto">
              <li className="navbar-item">
                <Link to="/" className="nav-link">
                  Home
                </Link>
                <Link to="/logout" className="nav-link">
                  Logout
                </Link>
              </li>
            </ul>
          </div>
        </nav>
      );
    } else {
      return (
        <nav className="navbar navbar-dark bg-dark navbar-expand-lg">
          <Link to="/" className="navbar-brand">
            Terminarz
          </Link>
          <div className="collpase navbar-collapse">
            <ul className="navbar-nav mr-auto">
              <li className="navbar-item">
                <Link to="/login" className="nav-link">
                  Login
                </Link>
              </li>
              <li className="navbar-item">
                <Link to="/register" className="nav-link">
                  Rejestracja
                </Link>
              </li>
            </ul>
          </div>
        </nav>
      );
    }
  }
}
